import PostAddForm from '../post-add-form/post-add-form';

import './app.css';


const data={
    label:'Going learn React',important:false
}

const App = () => {
    return (
        <div className="app">
            <AppHeader />
            <div className="search-panel d-flex">
                <SearchPanel />
                <PostStatusFilter />
            </div>
            <PostList />
            <PostAddForm />
        </div>
    )
};

export default App;
